import numpy as np

def dijkstra(P, depart):
    n = len(P)
    visited = [False] * n
    dist = [np.inf] * n
    dist[depart] = 0
    path = [-1] * n
    
    for _ in range(n):
        u = min((dist[i], i) for i in range(n) if not visited[i])[1]
        visited[u] = True
        
        for v in range(n):
            if P[u][v] > 0 and not visited[v] and dist[v] > dist[u] + P[u][v]:
                dist[v] = dist[u] + P[u][v]
                path[v] = u
    
    return dist, path

def dijkstraDistChemin(P, depart, arrivee):
    dist, path = dijkstra(P, depart)
    chemin = []
    etape = arrivee
    
    while etape != -1:
        chemin.insert(0, etape)
        etape = path[etape]
    
    if dist[arrivee] == np.inf:
        return "Pas de chemin", []
    else:
        return dist[arrivee], chemin



