    distance, path = dijkstraDistChemin(P, start_index, end_index)
    if path:
        print(f"Le chemin le plus court entre {start_city} et {end_city} est de {distance} km, en passant part :")
        for index in path:
            print(Z[index], end=" -> ")
        print("Arrivée")
    else:
        
        print("Pas de chemin possible.")
